import React from 'react';
import image1 from './sample.png';
import './home.css';

function Home() {
    return (
        <div className="slideShowContainer">
            
            <div className="mySlidesFade">
            <img src={image1} style={{width:"100%", verticalAlign:"middle"}} ></img>
            </div>
            
            <div class="mySlidesFade">
            <img src="img_snow_wide.jpg" style="width:100%"></img>
            </div>      

           
            
        </div>
    );
}

export default Home;
